import React from "react";
import RecipeResult from "./RecipeResult";

export default class SearchResultsComponent extends React.Component {
  componentDidMount() {
    this.count = 0;
  }


  render() {
    return (
        <div>
          <ul className="nav nav-tabs">
            {this.props.hits &&
              this.props.hits.map(hit => (
                  <RecipeResult
                      key={this.count++}
                      recipeData={hit}
                  />
              ))}
            }
          </ul>
        </div>
    );
  }
}
